import React, { Component } from "react";
import ToggleBox from "./ToggleBox";
import Vehicles from "./Vehicles";

export class _Login extends Component {
    render(){
        return (
            <ToggleBox title="Show Vehicles">
                <Vehicles />
            </ToggleBox>
        );
    }
}
